import RegisterLayout from "../components/RegisterLayout";

// const Index = () => <RegisterLayout/>;

function Index() {
  return (
    <RegisterLayout>
      <div className="menu-tile">
        <svg viewBox="0 0 56 18">
          <text x="0" y="15">Fit Me</text>
        </svg>
      </div>
      <div className="menu-tile">
        <span>Prywatni wystawcy</span>
      </div>
    </RegisterLayout>
  )
}

export default Index;
